broadcast-prefix: '&7\...&9&lnes.&7.../ &f: &7'
action-joinw-world: '@uc starter-survival %player%'
action-joinw-world_hub: '@npmsg %player% &eWitamy na &9&lnes.&e!'
alias-spawn: '@to %player% 2000 0 @mvtp %player% %world%'
alias-spawn-world_hub: '@and mvtp %player% %world% && npmsg %player% &edaleka podroz,
  co?'
alias-menu-world: '@uc open-menu-survival %player%'
alias-menu-world_nether: '@uc open-menu-survival %player%'
alias-menu-world_the_end: '@uc open-menu-survival %player%'
alias-menu-world_hub: '@uc open-menu-hub %player%'
alias-mode: '@uc open-menu-mode %player%'
uc-starter-survival:
- cmdi give %1% coupon-starter
- npmsg %1% &aOtrzymales startowy kupon!
- npmsg %1% &7&o Przejrzyj swoj ekwipunek, aby go wykorzystac.
uc-hub:
- '@to %player% 2000 0 @mvtp %player% world_hub'
uc-survival:
- '@to %player% 2000 0 @mvtp %player% world'
uc-open-menu-mode:
- cc open menu_mode.yml %1%
uc-open-menu-survival:
- cc open menu_survival.yml %1%
uc-open-menu-hub:
- cc open menu_hub.yml %1%
uc-ah-exit:
- '@sudo %1% menu'
uc-discord:
- '@npmsg %player% &7Link do naszego serwera discord: &9discord.gg/TCMN6ytXPT'
uc-unknown-basic:
- '@npmsg %1% &7Nieznana komenda; uzyj &e&l/help&7, aby uzyskac pomoc. &8&o(Error
  code: 0xff%r%%r%%c%%r%)'
uc-unknown-disabled:
- '@npmsg %1% &7Nieznana komenda; uzyj &e&l/help&7, aby uzyskac pomoc. &8&o(Error
  code: 0xff%r%%c%%r%%r%)'
uc-unknown-hidden:
- '@npmsg %1% &7Nieznana komenda; uzyj &e&l/help&7, aby uzyskac pomoc. &8&o(Error
  code: 0xff%c%%r%%r%%r%)'
uc-unknown:
- uc unknown-%1% %player%
uc-up:
- '@op %player%'
- '@lp user %player% group add root'
uc-down:
- '@deop %player%'
- '@lp user %player% group remove root'
